import "./DropGrid.css";
import DropSlot from "./DropSlot";

function DropGrid() {
  return (
    <div className="drop-grid-protrait">
      <DropSlot />
      <DropSlot />
      <DropSlot />
      <DropSlot />
      <DropSlot />
    </div>
  );
}
export default DropGrid;
